INSERT INTO `article` (`id`, `name`, `content`, `image`, `usercre`, `userchg`, `active_status`, `crcdt`, `chgdt`) VALUES
(2, 'B2bharat.com has been a blessing for us', '<p>My name is Vishal Singh. I am the owner of Tools and Business. We are a small family run business. My wife and I set up the shop about fifteen years ago. We deal primarily in power and hand tools, door and cabinet locks, sanitary fittings, plumbing tools, bathroom accessories, PVC pipes among others. About a year ago, our daughter suggested we try online trading. She said we could expand our business easily if we had internet presence.<br />At first, my wife and I were a little skeptical. We were not sure we could do it. Neither of us knew how to use a computer and the internet was far beyond our understanding. But our daughter was very encouraging and kept pressing us to do it. Finally, we agreed to try her suggestion. We asked her to look into the preliminary formalities. We thought it would take at least a few days to register and get the whole thing started. But when she came back the next day and told us it was done and that (insert shop name) now had a virtual account and we could start selling our products online, we were frankly shocked. We asked her how she managed it and she told us about <span style=\"color: #33cccc;\">B2bharat.com</span>. She explained how <span style=\"color: #33cccc;\">B2bharat.com</span> was revolutionizing online marketing. She showed us how simple <span style=\"color: #33cccc;\">B2bharat.com&rsquo;s</span> modus operandi was and how easy they had made online selling and buying for small town businesspeople like us. In the following days, our orders jumped to levels we had never witnessed before. We were very happy that our business was getting the right exposure.<br />Today, we supply hardware goods to customers all over India. We receive the orders online after which we pack and ship out the consignments to the customers. All payments happen online. It is a safe and secure mode. We do not have to chase the customers for payment. <span style=\"color: #33cccc;\">B2bharat.com</span> protects both the buyer and the seller&rsquo;s interests.</p>\r\n<p><br />To conclude, we can say that <span style=\"color: #33cccc;\">B2bharat.com</span> has been a blessing for us. Our small hardware business has grown by leaps and bounds because of the online marketing platform provided by <span style=\"color: #33cccc;\">B2bharat.com</span>. We are very happy with their service level and recommend them to anyone who is planning to do web-<br />based trading.</p>', '2.jpg', 'admin', 'admin', 1, 1500732882, 1508053290);
