(321, '0', 'Industrial Fabrication', 51, 'image_2017-12-17-18-51-47_5a366f6b5106b.jpg', 0, '', 'At B2bharat.com, we offer a virtual channel for B2B trade and commerce. We provide a convenient forum for buyers to get in touch with manufacturers and vendors of various goods and service. Our portal also provides visibility and greater geographical penetration to all our online sellers and service providers.\r\nIn industrial fabrication, we have suppliers dealing in various kinds of heat exchangers, reactor vessels, industrial vessels, pressure vessels and process tanks. Industrial furnaces and ovens including aging ovens, aluminum melting furnace, blast furnace, convection ovens, etc are available for sale on our website. Storage tanks like blending storage tanks and diesel storage tanks; and welding equipments like angle and bench grinders are also sold on our portal. Industrial fabrication works include custom fabrication, heavy steel fabrication, sheet metal fabrication and fabrication consultancy.\r\nB2bharat.com makes online procurement and sale of industrial fabrication goods and services convenient and hassle-free. Whether you are a small business owner or a large corporate entity, B2bharat.com throws open a world of possibilities for you and your organization. Come, join us and be a part of an amazing new journey.', '', '', '', 1, 1, '23-11-2015 05:09'),
