(2293, '0', 'Agricultural & Food Machinery', 51, 'image_2017-09-23-12-29-26_59c6064ea18d8.jpg', 0, '', 'B2bharat.com connects you to the widest network of agro-based companies dealing in agriculture equipment, fresh farm produce and vegetable seeds. We put sellers in touch with buyers and big procuring teams. B2bharat.com is your answer to all your agriculture machinery and farming needs.\r\nB2bharat.com offers crop processing machinery, drainage and irrigation machinery, feed processing machinery, fishery machinery, harvesting machinery, livestock machinery, oilseed processing machinery and general agriculture machinery. We have suppliers dealing in farm and garden cultivators, tractors and tractor parts and agriculture sprayers like aligning sprayers, hand compression sprayers, stirrup sprayers, etc. B2bharat.com has sellers offering animals and husbandry, dairy products like concentrated milk, eggs and cream, dried fruits like apricots and currants, and a whole range of farming and vegetable seeds. We also have vendors selling different kinds of fresh fruits, vegetables, grains, ornamental plants and trees and pots and planters. Fruits like acai berry, avocado, apricots, bael, apples and bell fruit; grains like bajra, barley, jowar and ragi; and vegetable like amaranth, artichoke, ash gourd and beet root are available for sale on B2bharat.com. Our farm produce is hand-selected and freshly picked/processed so you get only the freshest fruits, vegetables and dairy products.', '', '', '', 1, 0, NULL),
