(2315, '0', 'Chemicals & Solvents', 51, 'image_2017-08-08-23-28-04_5989fbac9a3d0.jpg', 0, '', 'B2bharat.com is the perfect online platform to trade in chemicals and solvents. Whether you are a manufacturer, wholesaler or buyer, we offer you a convenient channel to sell and buy chemical solvents. Interested buyers can send their queries to the concerned vendors though our website. They can also check and verify the profiles of companies listed on our portal. At B2bharat.com we take pride in engaging only the most reputed and reliable manufacturers and dealers. At the same time, we also safeguard the interests of the selling party by ensuring a fail-safe transaction system.\r\nWe have suppliers dealing in industrial chemicals like acid, activated carbon, aerosols, agrochemicals and pesticides, aluminum hydroxide and caustic potash. All kinds of industrial paints are sold on our website. These include acrylic distemper paint, acrylic emulsion, acrylic lacquer, anti-corrosive black paint and anti-bacterial paint, among others. We also sell organic and inorganic chemicals like alkali, oxide and inorganic acid and salts.\r\nB2bharat.com brings to you the widest range of industrial solvents and chemicals. Get in touch with us today and start trading.', '', '', '', 1, 0, NULL),
