(2346, '0', 'Construction plant & machinery', 51, 'image_2017-08-09-08-52-31_598a7ff7e9d96.jpg', 0, '', 'The real estate sector in India is growing by leaps and bounds. Rise in industrialization, increased investment in the private sector, FDI and the IT boom - all have contributed to the urbanization of our towns and cities. Big banner property builders are investing heavily in multi-storied housing complexes across the country. This has caused a spike in the demand for construction plant and machinery.\r\nIf you are into real estate and looking to purchase construction equipment, B2bharat.com can help you find what you need. We have vendors selling all kinds of building material making machinery like cement making machine, brick making machine and dry mortar machine. We offer construction machinery parts like bearings and pistons, pile drivers like diesel hammer and hydraulic pile driver and various types of tyres like bias belted tyre, OTR tyre, diagonal tyre and inner tube. In heavy machinery, we have cranes and lifting equipment, earth moving machinery, excavators, road paving machinery and stone crushers and allied machinery. Suppliers of construction machinery can also take advantage of our website to advertise their products and gain global exposure to widen their reach.', '', '', '', 1, 0, NULL),
