(2356, '0', 'Arts & Handicrafts', 51, 'image_2017-09-21-16-38-00_59c39d909f10e.jpg', 0, '', 'India has a vibrant arts and handicrafts industry. Our artisans are famous all over the world for their intricate, painstaking art work and designs. In fact, a large part of our local arts and craft products are exported to other countries where they sell at premium prices. \r\nB2bharat.com is a virtual B2B trading centre. We give buyers and sellers of handicraft goods a platform to do buy and sell their products. All items purchased via our website are of the highest quality as we engage only reputed traders and wholesalers. We also safeguard the interests of our traders through fail-safe monetary transactions.\r\nIn the arts and crafts sector, B2bharat.com brings visibility and international exposure to our handicrafts makers by offering them an opportunity to showcase their creations. We have suppliers dealing in flower pots and vases like bamboo flower pots, antique flower pots, clay flower pots, etc. Wooden and bamboo handicraft items such as bamboo baskets, bamboo handicrafts, wood crafts, wood animals, ash trays and boxes are bought and sold on B2bharat.com. We have different kinds of statues and sculptures including acrylic sculptures, brass sculptures, cement statues, copper statues and many more. Aquarium and aquarium accessories like aquarium fishes, fish food, nets, filters, lights and aquarium decorations are also available for sale on our portal.', '', '', '', 1, 0, NULL),
(2357, '0', 'Automobile & parts', 51, 'image_2017-09-21-16-41-17_59c39e5593264.jpg', 0, '', 'India has a booming automobile industry. Almost every major international brand has set up manufacturing plants in India. We are the largest three-wheeler market in the world and the second largest two-wheeler market. In terms of passenger cars, we are in the tenth position and we hold the fifth spot in the bus and truck category. This rapidly burgeoning industry has caused a surge in the demand for automobile parts and accessories. This is where B2bhaat.com steps in to meet that demand. B2bahrat.com is web-based buying and selling forum for B2B trade. Among its many product portfolios is automobile parts and machinery.\r\nWe have vendors dealing in all kinds of auto accessories, auto electrical and light systems, automotive tyre, tube and brake parts, automotive valves and pistons, automotive radiators and accessories and suspension and shock absorbers. For industrial use we have industrial gaskets, gasket seals and oil seals, automobile engine and spare parts and automotive fuel injection system and assemblies. B2bharat.com also has engineering experts who specialize in automobile body frame building for commercial vehicles, trucks, coaches and cars. Our auto mechanics offer their services in complete automobile repairing and maintenance.\r\nWhether you are a manufacturer of auto parts or an industrial buyer, B2bharat.com helps fulfill all your trade requirements. Avail of our wide range of services anywhere, anytime, at the press of a button.', '', '', '', 1, 0, NULL),
(2358, '0', 'Ayurved Product', 51, 'image_2017-09-21-16-45-55_59c39f6bd8c67.jpg', 0, '', 'India is the birthplace of Ayurveda or Ayurvedic medicine. It is 3000-year-old system of healthcare that uses herbal ingredients like roots, leaves, flowers and naturally occurring minerals and metals to prepare medicines. Ayurveda was developed during the Vedic period and the Indus Valley Civilization. Its medicines and methods of treatment are used widely today in the form of alternative medicines or complementary medicines.\r\nB2bharat.com has a veritable buffet of Ayurvedic, Herbal and Homeopathic medicines like aloe vera capsules, Ayurvedic pain balm, diabetic herbal medicine, Ashwagandha capsules, etc. We also have Ayurvedic practitioners offering Herbal and Ayurvedic services like accu-pressure, accu-puncture therapy and aroma therapy, among others. In herbal healthcare products we have various kinds of herbs like aloe vera, alpinia galangal, annona squamosa, asparagus racemosus and many more. Additionally, there are herbal extracts, essential herbal oils, natural and herbal henna and generic herbal products like broccoli juice powder, amla juice powder, etc.\r\nB2bharat.com engages only reliable and reputed herbal manufacturers and vendors. All products sold on our website are 100% natural and free of chemicals and adulteration. Sellers of Ayurvedic products also gain extensive visibility through our web portal. By showcasing their wares and services on B2bharat.com, they are able to connect with a larger customer base. In other words, B2bharat.com is a great online trading forum for both suppliers and procurers.', '', '', '', 1, 0, NULL),
(2359, '0', 'Books , Stationery & Office Supplies', 51, 'image_2017-09-21-16-49-49_59c3a055da9fe.jpg', 0, '', 'Every household and office needs stationery items. Ball pens, adhesive tape, calendars, files, office paper, etc are some commonly used stationery products. B2bharat.com brings together traders and buyers of stationery goods for B2B trade. We make online buying and selling easier, faster and safer. By pressing a few buttons, interested parties can check the products they need and place their orders. They can also verify the sellersâ€™ credentials by reading customer reviews and their company portfolio. B2bharat.com allows only the most trusted names in every business category to offer their products for sale on its website.\r\nIn stationery goods, we have a wide selection of printers, scanners, projectors and binding machines. Video and voice conferencing systems, voting systems and simulated interpretation systems are sold on our portal. Office equipment like calculators, copiers, shredders, presentation boards, time and attendance recording machines and training equipment are available at attractive prices on our website. Whatever your stationery needs, B2bharat.com can help meet it. Just browse through our expansive catalogue, choose the products that suit your requirements and budget, and complete the purchase. The goods will be delivered at your doorstep within the stipulated time.', '', '', '', 1, 0, NULL),
(2360, '0', 'Electricales & Electronics', 51, 'image_2017-09-23-14-20-17_59c6204989e9d.jpg', 0, '', 'Electrical and electronic goods have become a fundamental necessity in todayâ€™s modern times. Appliances like fans and coolers, laptops and desktops, inverters and generators have become an integral part of our day-to-day lives. B2bharat.com brings to you the best in electronics and electrical appliances. We are an online marketplace where manufacturers and procurers meet for the purpose of B2B business. We have leading electronics brands offering their goods and services on our website.\r\nB2bharat.com connects you with suppliers of cables and wires, cable conduit, cable gland, cable tie and cable trays. We have vendors dealing in all types of lights, board connector, breaker and protector, capacitors, circuit boards, circular connectors, control panels and boards. We sell computer parts and accessories, computer software, UPS, electric motor, electrode, electrical equipment and components, inductors, insulation, insulators and insulation material. All kinds of switches, wiring ducts, transmitters and transformers, time and attendance recording appliances, switch-gears, tie mounts, street light and poles, semiconductors and sensors, resistors and potentiometers, relay and connector and integrated circuits are also sold on our website. In addition, there are services providers offering computer hardware and maintenance services, online education and training services though the medium of our portal.', '', '', '', 1, 0, NULL),
(2361, '0', 'Furniture', 51, 'image_2017-09-23-14-38-08_59c6247833edf.jpg', 0, '', 'When it comes to trading in furniture and furnishing, B2bharat.com offers both manufacturers and buyers the best online platform. Our vendors offer quality goods, and all transactions done via our website are fully safe. Buyers can check the supplierâ€™s company profile and read customer testimonials to verify their credentials before placing an order. This safeguards the buyers against fraudulent suppliers and also ensures payment safety for suppliers.\r\nOur furniture makers specialize in all kinds of home and office furniture. We have bedroom furniture, commercial and office furniture, children and baby furniture, garden and outdoor furniture, modular kitchen furniture, medical and hospital furniture and general home and household furniture. B2bharat.com has a large collection of wardrobes, wooden sofas, bathroom and cabinet furniture, furniture racks and shelves. Buyers can select furniture by style like antique cabinets and tables, and furniture by material like acrylic chairs and aluminum chairs. There are also exhibition and trade show equipment, different patterns of doors, window frames, shutters and panels, door and window fitting accessories, furniture parts and accessories, display stands and fixtures, brackets, holders and hardware fittings, wheels, casters and rollers. For those looking for service providers, we have vendors offering furniture making and carpentry services and interior and decoration designing.', '', '', '', 1, 0, NULL),
(2362, '0', 'Health & Medical', 51, 'image_2017-09-23-14-43-05_59c625a15f5ae.jpg', 0, '', 'B2bharat.com is the best place to vend and procure health and medical supplies. We have tie-ups with leading medical equipment manufacturers both in India and abroad. These are top healthcare companies that offer nothing but the finest in healthcare products and appliances. At B2bharat.com, we understand your needs. Our web portal is simple and easy to use. Interested buyers can browse through our collection of products and place their orders online without any hassles. Similarly, sellers of medical supplies can also gain extensive exposure through our website and sell their goods to buyers all over the world.\r\nB2bharat.com offers anesthesia equipment and products, dental equipment and products, diagnostic equipment and products and rehabilitation equipment and products. We have vendors of suction machine and units, surgical power tools and products, orthopaedic implants and instruments and gynecological products. Also offered for sale are autoclaves and sterilizers, height and weight scales, hospital hollow-ware, laboratory products, hospital medical furniture, medical disposables, medical machine and refrigerators, medical rubber products, OT and examination light and general instruments.', '', '', '', 1, 0, NULL),
(2363, '0', 'Jewellery , Gems & Stone', 51, 'image_2017-09-23-14-46-06_59c62656cfced.jpg', 0, '', 'India is known for its ethnic jewelry and rare precious stones. For centuries, rulers and conquerors from around the world have been drawn to India because of its rich reserve of precious metals and stones. We are home to some of the most expensive stones and intricate handcrafted jewelry in the world.\r\nToday, with the advancement in technology, people can buy and sell jewelry at the click of a button. This is where B2bharat.com enters the arena. We are an online marketplace for buyers and sellers to meet and buy and sell jewelry, gems and stones.\r\nB2bahrat.com connects buyers with jewelers who deal in diamond jewelry, gold jewelry, platinum jewelry and solitaire jewelry. Offered for sale are bangles, rings, earrings, mangalsutras, pendants, anklets, chains and necklaces in stunning and rare designs. In menâ€™s jewelry, we have kadas, chains, cuff links and studs. B2bharat.com has vendors dealing in all kinds of gemstone jewelry, artificial jewelry and fancy antique and beaded bangles and anklets. For those looking to invest in gold, we have gold bullion, gold coins and gold bars. B2bharat.com also have a wide network of numerology experts offering astrology and numerology services. For makers of jewelry, we have all kinds of jewelry making machines and equipment like ceramic diamond wheel, diamond cutting machine, CNC jewelry tools and beading tools.', '', '', '', 1, 0, NULL),
(2364, '0', 'Machine Tools & Hardware', 51, 'image_2017-09-23-14-50-25_59c627596ff58.png', 0, '', 'Rapid growth in the industrial sector has caused a spike in the demand for machine tools and hardware. B2bahrat.com brings to you some of the best manufacturers and dealers of industrial equipment and tools. We are a one-stop-shop for all your machine tools and hardware needs. B2bharat.com virtually connects buyers and sellers for the purpose of buying and selling goods and services online. \r\nWe have tied up with leading manufacturers of machine tools for selling electric drill, electric saw, electric screwdriver, grinder, files, fasteners and fitting, cutter and tongs, brush, bearing, chisel and axe via our web portal. We have vendors offering various kinds of diamond tools, drilling tools, hydraulic tools, hydraulic parts, hand tools and general home hardware.\r\nIn industrial abrasives, we have all kinds of abrasive grains, powder, belts, cloths, rolls and fiber discs. We sell bathroom fittings and accessories and general hardware accessories. We also offer grinding balls, grinding powder, grinding wheel, different types of moulds, pipe fittings, punch, rotary hammer, sanding paper, sealing and gaskets, sharpening stone, springs, valves and wheel and castor.', '', '', '', 1, 0, NULL),
(2365, '0', 'Manufacturing Plant &  Machinery', 51, 'image_2017-09-23-14-54-22_59c62846cdb27.jpg', 0, '', 'B2bharat.com is the best web-driven platform to shop for all your industrial material and heavy equipment needs. We have liaised with top industrial goods manufacturers to bring the best in light and heavy machinery within your reach. All you have to do is go through our catalogue of manufacturers and suppliers, select the items you need and place your order online. Likewise, sellers can also find buyers and big corporate procurers for their finished goods on our portal.\r\nAmong the products sold on our website are blowing machines, cable machinery, chemical machinery, chemical plant and CNC machines. There are casting and forging molds and dies, light and heavy cranes and lifting machines, filter machinery for air purification and general machinery and tools like boring, drilling and crushing machines. We also have various kinds of grinding and milling machinery, industrial machinery, glass, paper and ceramic machinery, garment and shoes machinery, packaging machinery, printing machinery, rubber machinery, leather machinery, mining and metallurgy machinery, metal, stone and wood processing machinery. Plastic machinery includes plastic machines, plastic extruder, pipe, bar, tube bending machines and PVC machines. We deal in water treatment plants, weighing machines, welding machines, wire drawing machines and wire winding machines. B2bharat.com also offers a wide range of dairy equipment like dairy plants, dairy products machinery, filter machinery and other food processing plants and machinery.', '', '', '', 1, 0, NULL),
(2366, '0', 'Metals, Mineral & Energy', 51, 'image_2017-09-23-15-04-57_59c62ac1486dd.jpg', 0, '', 'India is a big producer of metals and alloys. Naturally occurring elements like iron, aluminum and copper are mined in large quantities and consumed domestically and also exported to many countries. Alloys like steel and brass are extensively used in construction, automobile and defense sectors. Their demand never falls and always remains consistent. Therefore manufacturing companies need to find credible and reliable sources of metals and alloys to consistently meet this demand.\r\nB2bharat.com is a hub of aluminum, copper, iron and steel manufacturers and suppliers. Products traded on our website are quality checked and 100% genuine. Our vendors deal in different kinds of alloys and alloy products like brass anchor, brass coils, stainless steel products like steel bars, rods, coils, fittings and panels. Wire mesh made of aluminum alloy and brass is also sold on our portal.  Various kinds of mining products like activated carbon, carbon black, coke, charcoal, etc and scrap and waste material like alloy steel scrap, brass scrap, aluminum scrap, etc are available for sale. Brass and copper products like brass copper wire and brass balls, bars, billets, coils, etc are traded on B2bharat.com. Aluminum is another major metal sold on our website. We have everything from aluminum bends, brackets, channels, cladding, lugs, foil cover and foil seals.', '', '', '', 1, 0, NULL),
(2367, '0', 'Packaging Goods & Machinery', 51, 'image_2017-09-23-15-08-08_59c62b8081bd5.jpg', 0, '', 'The rise in industrialization has created a huge demand for packaging material and machinery. Packaging material is used for sealing and packing finished products before they are dispatched from factories for sale in the retail market. Corrugated boxes, packaging films, foils and protective wraps, thermocol packaging products, etc are some of the different types of packaging material. Packaging plays a vital role in safeguarding goods against damages, loss and pilferage.\r\nB2bharat.com understands the importance of good packaging. We have a large network of manufacturers and procurers of packaging material and packaging machinery. Our portal has all kinds of plastic and paper bags, plastic and paper pouches and plastic bottles, jars and caps. The suppliers also supply wooden and plastic pallets for holding and transporting cartons, industrial tape, packaging adhesives, glue and sealants for sealing boxes and cartons. There are special food packaging materials and supplies, MS, SS and plastic drums. Also offered for sale are large industrial packaging machines like Auger Filler machine, automatic pouch packing machines and bottle filling machines, to name a few.', '', '', '', 1, 0, NULL),
(2368, '0', 'Paper Products', 51, 'image_2017-09-23-15-11-36_59c62c50e686a.png', 0, '', 'Paper has many uses. It plays a fundamental role in education, advertising, arts and crafts. Paper comes in many forms like plain white sheets, textbooks, paper bags, greeting cards, advertising hoardings and handmade craft paper, to name a few. Paper is needed in homes and offices, and is used widely in restaurants, galleries and hospitals. In fact, almost every industry you can think of needs paper to run its day-to-day operations.\r\nB2bharat.com is a great place to purchase paper and paper products. If you are a seller of paper goods, you can find buyers for your products on our website. B2bharat.com also helps buyers find quality vendors of paper products like greeting cards, customized wedding cards, handmade greeting cards and custom business cards. There are also service providers who provide paper binding and printing services like banner vinyl printing services, book binding services, calendar printing and catalog printing services. For those dealing in art and painting, we have a wide collection of handmade paper products like calligraphy paper, handmade embossed paper, flocking paper, etc. All kinds of white, colored, butter, art and carbon paper are also sold through B2bharat.com. In addition, we have suppliers of craft paper bags, brown paper bags, designer paper bags, Eco friendly paper bags, paper boxes and many more.', '', '', '', 1, 0, NULL),
(2369, '0', 'Rubber & Plastic', 51, 'image_2017-09-23-15-13-52_59c62cd838571.jpg', 0, '', 'B2bharat.com is a web-based shopping portal for business enterprises. We connect companies for online B2B procurement and sale of goods and services. We make buying and selling a lot easier, faster and safer. B2bharat.com has many vendors vending their products on the website and a sizable customer base to keep the demand high. The idea is to give sellers more domestic and global exposure and make them easily accessible to interested buyers and big industrial procurers.\r\nIn the realm of rubber and plastic goods, B2bharat.com has a large pool of merchandisers showcasing their wares. Plastic materials, plastic moulds, FRP/GRP, plastic pipe and tube, plastic rods, plastic sheets, boards and panels, plastic strap and tape and miscellaneous plastic products are sold on our website. Rubber goods like rubber belt, polymer and resin, rubber mould, rubber pad, rubber roller, rubber row material, rubber seal, rubber sheet and mat, synthetic fibers, different kinds of rubber and plastic chemical and all other rubber materials are also offered for sale on our portal.\r\nIn other words, B2bharat.com is a one-stop-shop for all your plastic, rubber, synthetic and polymer goods requirements. Come, discover great products and explore new possibilities for your business through B2bharat.com.', '', '', '', 1, 0, NULL),
(2370, '0', 'Safety product', 51, 'image_2017-09-23-15-16-55_59c62d8f61c6d.jpg', 0, '', 'Safety comes first. At B2bharat.com we understand the importance of safety. To preempt any kind of injury and damage to life and property, we need to take adequate preventive measures. These include following safety rules always and using protective gear and safety appliances to keep out of harmâ€™s way.\r\nB2bharat.com is an online marketplace for buyers and sellers of safety products and services to congregate and do business. We have quality vendors who sell industrial safety goods like safety glasses, safety helmets, safety gloves, safety masks, safety shoes and earmuffs for ear protection. There are also dealers of construction safety products like scaffolding net, caution board, caution tape, safety and protective apparel. Road safety devices like road studs, safety belts, safety ropes, roadway safety mirrors, safety barriers and speed bumps are also sold on B2bharat.com.\r\nTransactions made through B2bharat.comâ€™s portal are completely secure. We provide an easy and hassle-free means for buyers to purchase goods and services, and for sellers to sell their wares. So, whether you are a manufacturer, wholesaler, dealer, retailer or a buyer or investor looking to make a purchase, B2bharat.com has something for everybody.', '', '', '', 1, 0, NULL),
(2371, '0', 'Security & Protection Equipment', 51, 'image_2017-09-23-15-19-06_59c62e12567d5.jpg', 0, '', 'In todayâ€™s urban housing scenario with multi-storied apartment complexes huddled close together, home security has become paramount. A typical housing society witnesses a constant stream of incoming and outgoing people. It is impossible for the security personnel at the entry and exit points to keep a round-the-clock check on all these movements. Therefore, securing the premises with the help of security and protection equipment has become a necessity. Such equipment includes basic security devices like CCTV surveillance system and firefighting system complete with fire alarm and fire detection devices.\r\nB2bharat.com has tied up with leading security equipment makers in the country and the world to bring to you the best in security and protection equipment. We virtually connect buyers with sellers dealing in home and office security appliances and services. B2bharat.com also has vendors offering electronic devices for monitoring time and attendance used mostly in factories and offices. Access control devices, biometric attendance systems, face recognition systems and biometric finger scanners are all available on our website at attractive prices. We also have suppliers selling sophisticated drone and surveillance systems, wireless spy cameras, night-vision cameras, water-proof cameras, infrared cameras, vandal-proof cameras, etc.', '', '', '', 1, 0, NULL),
(2372, '0', 'Services', 51, 'image_2017-09-23-15-21-49_59c62eb5bb35d.jpg', 0, '', 'India has a booming service industry. Spread of education and increase in investment, both domestic and foreign, has given a big fillip to the service sector. Every day scores of new opportunities are created in advertising, media and publishing, transportation, logistics, travel and tourism, event planning and event organizing.\r\nB2bharat.com brings to you the best people to do business with in the service sector. We have the most credible service providers from every field from CA and accounting services to engineering services to financial and legal services. We have some of the most competent tax, accounting, audit and legal consultants, HR planning and recruitment companies offering their services on our portal. Leading furniture makers and carpentry services offer their products and services through our website. Pest control services, metal finishing and coating services, travel agents, hotel agents, electrical and signaling contractors and facility management services are all available on B2bharat.com. These service providers are fully qualified and come with years of experience. B2bharat.com only allows reliable and reputed consultants to do trade through their website. Similarly, the consultantsâ€™ interests are also protected as all buyers on B2bharat.com are genuine. Come, explore the possibilities with B2bharat.com. We offer you nothing but the best in all services.', '', '', '', 1, 0, NULL),
(2373, '0', 'Sports ,Toys & Fitness Equipment', 51, 'image_2017-09-23-15-25-15_59c62f83a6b1b.jpg', 0, '', 'B2bharat.com brings together a wide network of sellers and buyers dealing in sports gear, fitness equipment and toys. All kinds of outdoor sports goods and accessories, sports protection gear, water sports goods, yoga equipment and supplies, educational toys, musical toys, outdoor toys and many more are sold on our website. B2bharat.com only liaises with dependable vendors whose products are quality-checked and 100% genuine. The buyer base is also large leading to good demand in all categories of sports goods and toys.\r\nB2bharat.com believes in the importance of having the right gear. Gear is anything that you wear or use while playing a sport or doing physical exercise, like bats and balls in cricket, dumbbells and barbells in gyms, special kinds of clothing, footwear, equipment and accessories for different sports and fitness workouts, etc. In sports, having the right gear can improve your game and overall performance. Similarly, to do workouts in gyms, to do yoga and other health and wellness regimens, there are specific equipment, clothes and accessories. B2bharat.com is a virtual marketplace where you can buy and sell all these amazing goods. In addition, we offer fishing tackle and equipment, sporting goods, sports bikes, scooter and boards, sports field equipment and services, swimming pool and accessories and team sports goods and supplies.', '', '', '', 1, 0, NULL),
(2374, '0', 'Textile & Furnishing', 51, 'image_2017-09-23-15-27-11_59c62ff7793f0.jpg', 0, '', 'India is a major global producer of natural fibers like cotton, jute, silk and wool. It holds the second spot in terms of total annual fiber yield. India is the largest jute producer and the second largest cotton producer in the world. In fact, the textile industry in India is so wide-spread that it is the second biggest employment-generating industry for both skilled and unskilled labor in the country.\r\nB2bharat.com offers a convenient web portal for sellers and buyers dealing in textile and furnishing to come together and do business. B2bharat.com has tie-ups with top textile vendors who sell quality items of home furnishing like curtains, mats, table cloths and towels suited to everyoneâ€™s taste and needs. Carpets and rugs of every make and design are available on the portal. Home dÃ©cor items like bed sheets, pillow cases, blankets, etc. are sold on B2bharat.com. Also, on offer are a wide range of fabrics and fiber like chemical and compound fiber, denim, embroidery work, etc. All kinds of sleeping mattresses like coir, foam, air and foldable mattresses, to name a few, are also sold on B2bharat.com.\r\nApart from sellers of textile, B2bharat.com also attracts buyers from all over the world, making it a great place to buy and sell goods online.', '', '', '', 1, 0, NULL),
