(1, '<p>Welcome to B2Bharat.com</p>\r\n<p><strong>DON\'T BE BUSY</strong></p>\r\n<p><strong>DO BUSINESS EASY</strong></p>', '<p>coming soonbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbb</p>', '<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline; color: #00ccff;\"><strong>B2bharat.com</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>B2bharat.com makes buying and selling easier, faster and more economical. We provide a convenient platform for all businesses to reach more customers, boost sales and garner higher profits.</p>\r\n<p><br />Our forum gives you access to an ever-burgeoning virtual global marketplace. No matter where in the world you are, B2bharat.com helps you sell and buy anything, anytime, at the click of a button. Our medium of web-based marketing is safe, hassle-free and cost-effective. We support micro, small, medium and large enterprises, and afford never-before- like visibility at an international level.<br />B2bharat.com truly is your ticket to limitless opportunities and unprecedented success.</p>\r\n<p><br /><span style=\"text-decoration: underline; color: #00ccff;\"><strong>About Us</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>We are a one of a kind online marketing hub for buyers and suppliers alike. Our interface is designed to make communication between trade partners easier, faster and more transparent. We provide a secure environment for businesses to come together, connect, negotiate deals, enter into contracts,collaborate and form lasting partnerships.<br />Whether you are a start-up or an established corporate behemoth, B2bharat.com has something for everyone. Fledgling companies can avail of our resourceful launch pad to start their business. Large enterprises can connect with quality suppliers and ink better deals. Even mom-and- pop stores and small family-owned businesses can trade better through our forum. Our wide network enables everyone to broaden their customer and vendor bases.</p>\r\n<p><br /><span style=\"text-decoration: underline; color: #00ccff;\"><strong>Our Mission</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>B2bharat.com was formed in the year 2015 with the objective of creating a virtual souk to aid trade and commerce. Our services help business entities find the right partners. Here&rsquo;s how our portal works:</p>\r\n<p><br />ïƒ˜ Open your own virtual store/business on our website.<br />ïƒ˜ Build a portfolio of your products and services (if you are a seller).<br />ïƒ˜ Post your requirement (if you are a buyer).<br />ïƒ˜ Our portal will provide you with Trading Statistics which includes products, selling and buying leads and a list of companies in every category.<br />ïƒ˜ Select the items you want to buy, or the sellers you want to sell your items to.<br />ïƒ˜ Connect with the seller/buyer through our portal.<br />ïƒ˜ Discuss requirement.<br />ïƒ˜ Draw up the terms of your contract.<br />ïƒ˜ Complete your deal.</p>\r\n<p><br />B2bharat.com offers ease of commerce. We simplify things. Our web interface helps users connect with credible and legitimate buyers and sellers. We offer a reliable platform. Our leads and listings are bonafide and verified.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline; color: #00ccff;\"><strong>Our Values</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>Trust. Timeliness. Team Work. These are the three edifices of our value system. At B2bharat.com, we strive to forge enduring relationships with our customers. Our goal is to deliver on time, every time, and keep our users not only satisfied, but delighted. We also put a lot of stress on team work because we believe we can achieve monumentally more as a team.</p>\r\n<p><br />Come. Join the revolution. Be a part of the global market. B2bharat.com can help your business achieve success like never before.</p>', '<p><span style=\"text-decoration: underline;\"><strong>Terms and Conditions</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br /><span style=\"color: #ff6600;\"><em><strong>Conditions of use</strong></em></span></p>\r\n<p><br /><span style=\"color: #00ccff;\">B2bharat.com</span> operates within the ambit of certain terms and conditions. Any user who visits our website or avails of our online marketing services, is taken to have accepted our terms and conditions, and becomes automatically bound by them.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><em><strong><span style=\"color: #ff6600;\">Privacy</span></strong></em></p>\r\n<p><br />Kindly read our Privacy Policy to know more about our practices.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><em><strong><span style=\"color: #ff6600;\">Electronic Communications</span></strong></em></p>\r\n<p><br />We communicate with our users by posting notifications on our website and through email. When a user visits our website or gets in touch with us via email, it is assumed that they agree to also receive notifications from us. It is also implied that they agree that all communications like notices, agreements<br />and disclosures sent/posted by us satisfy any legal requirement that such communications be in writing.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><span style=\"color: #ff6600;\"><em><strong>Copyright</strong></em></span></p>\r\n<p><br />All content on our website like literature, graphics, images, logos, button icons, audio clips, data compilations, digital download and software, are the exclusive property of <span style=\"color: #00ccff;\">B2bharat.com</span> or its content providers. All such content are protected by International Copyright laws. The copyright authorship of the entire compilation of <span style=\"color: #00ccff;\">B2bharat.com&rsquo;s</span> web content lies with <span style=\"color: #00ccff;\">B2bharat.com.</span></p>\r\n<p>&nbsp;</p>\r\n<p><br /><span style=\"color: #ff9900;\"><em><strong>Trade Marks</strong>