ntent across the globe via any medium. Also, by posting their content on our webpage, users are deemed to have granted <span style=\"color: #00ccff;\">B2bharat.com</span>, its subsidiaries and sub-licensees the right to use the name they submitted along with their content. Further, users represent and warrant that control and ownership of their content lies with them alone, that the content is correct and genuine, that use of the content does not contravene any policy or law, that the content is not injurious to any business entity or third party, and finally, that in the event of any claim arising from the content supplied by the user, the latter will indemnify<br /><span style=\"color: #00ccff;\">B2bharat.com</span> and its associates. <span style=\"color: #00ccff;\">B2bharat.com</span> is not responsible and liable for any content uploaded by its users and third parties.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><em><strong><span style=\"color: #ff6600;\">Risk of Loss</span></strong></em></p>\r\n<p><br />All products purchased from <span style=\"color: #00ccff;\">B2bharat.com</span> are made pursuant to a shipping contract which means that the title of goods and risk of loss are both passed on to the user/buyer as soon as <span style=\"color: #00ccff;\">B2bharat.com</span> hands over the goods to the carrier.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em><strong><span style=\"color: #ff6600;\">Product Descriptions</span></strong></em></p>\r\n<p><br /><span style=\"color: #00ccff;\">B2bharat.com</span> and its associates strive to keep all communications and details accurate. However, <span style=\"color: #00ccff;\">B2bharat.com</span> and its associates do not warrant that product details and other related content available on our portal are 100% accurate, free of errors, complete, comprehensive, dependable or current. In case a user is not satisfied with a product bought through our website, the only remedial action is to<br />return it unused.</p>\r\n<p>&nbsp;</p>\r\n