 laws, will govern the Conditions of Use. Such laws will further apply to any kind of dispute that may arise between <span style=\"color: #00ccff;\">B2bharat.com</span> and its associates.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><em><strong><span style=\"color: #ff6600;\">Disputes</span></strong></em></p>\r\n<p>In the event of a dispute arising from a user&rsquo;s visit to, or use of our web portal, or any purchase made on our portal, such dispute shall be submitted for confidential arbitration in define-state, define-country. However, if the user has infringed, or threatened to infringe, the intellectual rights of <span style=\"color: #00ccff;\">B2bharat.com</span>, the latter may seek injunctive or other remedial relief in any federal court in the state of define-state, define country, and the user consents to exclusive jurisdiction and venue in such courts. The rules of the American Arbitration Association will apply to any arbitration/dispute that may arise under this agreement. The award of the arbitrators shall be binding and may be taken as a judgment in a court of<br />competent authority and jurisdiction. To the fullest extent sanctioned by the applicable laws, no arbitration under this agreement shall be combined with any other arbitration involving any party that comes under the purview of this agreement, whether through class arbitration proceedings or otherwise.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><em><strong><span style=\"color: #ff6600;\">Site Policies, Modification and Severability</span></strong></em></p>\r\n<p><br />Users are encouraged to carefully read the Shipping and Returns Policy available on our website as these policies also govern their dealings with our web portal. We reserve the right to make changes in our policies and terms and conditions if we deem necessary. If any clause or policy is found to be void or invalid or in any manner incapable of being legally enforced, such clause or policy will be removed from our website, and such removal shall not affect the validity and enforceability of the remaining clauses and policies.</p>\r\n<p>&nbsp;</p>\r\n<p><br /><em><strong><span style=\"color: #ff6600;\">Questions</span></strong></em></p>\r\n<p><br />Queries relating to our Conditions of Use, Privacy Policy and other rules and clauses may kindly be submitted to our Support Staff. Simply click on the Contact Us link at the bottom of our Home Page.</p>\r\n<p><br />Alternately, you can write to us at <a title=\"Email to B2Bharat.com\" href=\"mailto:info@b2bharat.com\" target=\"_blank\"><span style=\"text-decoration: underline;\">info@b2bharat.com</span></a>. Someone from our company will get in touch with you shortly.</p>', '<p style=\"text-align: left;\"><strong>Privacy policy</strong></p>\r\n<ol style=\"text-align: left;\">\r\n<li><strong>Introduction</strong>\r\n<ul>\r\n<li>B2B Bharat.com is committed to safeguarding the privacy of our website visitors and our valuable customers and in this policy, we will explain how their personal and business information will be treated.</li>\r\n<li>By using our website and agreeing to this policy, you consent to our use of cookies in accordance with the terms of this policy. This policy may be subject to changes without prior notice. Please check the latest version periodically.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Collection and use of your personal information</strong></li>\r\n<li>\r\n<ul>\r\n<li>We will collect all the information of your account such as your company name, company&rsquo;s address, all types of contact numbers, email etc. This is to enforce the agreement between you and B2B Bharat.com, to ensure that you are reachable by potential trade partners.</li>\r\n<li>Additionally, information will be recorded when you browse and visit our website, such as cookies, IP address, etc. This information will help us and will be used to avoid you being attacked by harmful entities and to customize service to the end user. To visit B2B Bharat.com, your browser should be configured to accept cookies.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Use of personal information</strong></li>\r\n<li>\r\n<ul>\r\n<li>Personal information submitted through B2B Bharat.com, such as company name, address, contact person, telephone number, etc. will be published publicly and thus will be accessible to all users. The purposes for the same includes personalization of website as per user&rsquo;s need, enabling of users required/paid services of B2B Bharat.com, doing analysis and research regarding user&rsquo;s location, for goods deliveries, for sending online statements, invoices and/or any reminders, sending you various communications and/or any email notification/newsletter (if requested), to deal with any of your complaints/feedback/enquiries, and so on.</li>\r\n<li>The main purpose of this is to get a better understanding of our users for the betterment and persistence of an always improving company.</li>\r\n<li>Your privacy settings can be adjusted using privacy controls on the website.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Sharing personal information</strong></li>\r\n<li>\r\n<ul>\r\n<li>B2B Bharat.com may share/disclose any of the user\'s personally identifiable information when either we have the user\'s permission or under special circumstances which seems to be reasonably necessary for the purposes set out in this policy.</li>\r\n<li>We may also disclose user&rsquo;s account information in special cases when we have reasons to believe that disclosing this information is necessary to identify, contact or bring legal action against someone who may be violating B2B Bharat.com Terms of Services or may be causing injury to or interference with (either intentionally or unintentionally) B2B Bharat.com&rsquo;s rights or property, or if B2B Bharat.com seems it necessary to maintain and improve its products and services.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Security of personal information</strong></li>\r\n<li>\r\n<ul>\r\n<li>B2B Bharat.com takes necessary and reasonable security steps to prevent any unauthorized, illegal access and any loss, misuse or alteration of user\'s information.</li>\r\n<li>All Registration and Account Information of registered users can be viewed/edited through their account, which is protected by a password. We recommend that you do not share your password to anyone. we will not ask you for your password (except when you log in to our website). We request our users to always remember to sign out of their account and close your browser window when you have finished your session.</li>\r\n<li>No data transmission over the internet or any wireless network can be guaranteed to be perfectly secure. As a result, while we try to protect the information we hold for you, we cannot guarantee the security of any information you transmit to us and you do so at your own risk.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Amendments</strong></li>\r\n<li>\r\n<ul>\r\n<li>We may update this policy from time to time by publishing a new version on our website.</li>\r\n<li>Please check this page periodically for any updates to this policy.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Your rights</strong></li>\r\n<li>\r\n<ul>\r\n<li>We may withhold personal information that you request to the extent permitted by law.</li>\r\n<li>You may instruct us at any time not to process your personal information for marketing purposes.</li>\r\n<li>In practice, you will usually either expressly agree in advance to our use of your personal information for marketing purposes, or we will provide you with an opportunity to opt out of the use of your personal information for marketing purposes.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Third party websites</strong></li>\r\n<li>\r\n<ul>\r\n<li>Our website includes hyperlinks to, and details of, third party websites.</li>\r\n<li>We have no control over, and are not responsible for, the privacy policies/ practices of third parties.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Cookies</strong></li>\r\n<li>\r\n<ul>\r\n<li>We use cookies. It stores specific information about our users and also keeps a track of visitors.</li>\r\n<li>A cookie is a file containing an identifier (a string of letters and numbers) that is sent by a web server to a web browser and is stored by the browser. The identifier is then sent back to the server each time the browser requests a page from the server.</li>\r\n<li>Cookies may be either \"persistent\" or \"session\" cookies: a persistent cookie will be stored by a web browser and will remain valid until its set expiry date, unless deleted by the user before the expiry date; a session cookie, on the other hand, will expire at the end of the user session, when the web browser is closed.</li>\r\n<li>Cookies do not typically contain any information that personally identifies a user, but personal information that we store about you may be linked to the information stored in and obtained from cookies.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p style=\"text-align: left;\">&nbsp;</p>', '', '103.75.56.234', 1, NULL, 'admin', 0, 1508051899, '43af459804e3f5727b26e6a58973b004', '3a6de8e78b05a9e7e957bc6774097f80', '');
