(234, 485, 'Green Touch Paint', 'Green Touch Paints', 'seller', '101', '4500', 'Mr.Shekhar Tipale', '110', '8819020386', '8819020386', NULL, '', '', '', '', 'AMZPC8613M', 'AMZPC8613', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Plot No.J-290, Near Indrayani Nagar, Bhosari, MIDC, Pune - 411026, Maharashtra, India', '89', '411026', 'http://www.greentouchpaints.com', 'We are one of the leading manufacturers and suppliers of Paints and Coatings, which is used for various industrial applications. Our range includes Oil Paints, Alkyd Resin, Polyurethane Paints, Thinners, Synthetic Enamels, and Quick Drying Paint. We also offer to our clients Epoxy Paints, Stoving Paints, Wood Coating Paints & Lacquers, Acid Proof Paint & Lacquers, Epoxy - Coaltar Paints, and Economical Red Oxide Primer. These products are developed using high-grade raw material and as per the set industry standards. \r\n\r\n\r\nSome of the features for which these paints and coatings are acknowledged in the market are as follows:\r\nâ€¢	Excellent color retention property\r\nâ€¢	Good adhesion to ferrous, non-ferrous, plastic & concrete surface\r\nâ€¢	Scrub and stain resistance\r\nâ€¢	Alkali & chemical resistance\r\nâ€¢	Excellent weathering resistance\r\nâ€¢	Eco-friendly\r\nâ€¢	High durability\r\nâ€¢	Washable\r\nâ€¢	Resistant to bacterial growth\r\nâ€¢	Retains high gloss level\r\n\r\nApart from this, we also meet the demands of Petrol Resistance Paints and Chlorinated Rubber Paints.', '', '', '5000 to 10000 sq. ft.', '1970-01-01', '50 to 100', 'rs. 5 â€“ 10 crore', '', 'Green Touch Paint Industries was incepted in the year 1979, and has established a repute of most promising Manufacturer and Supplier firm delivering best in class range of Coating Materials. Our efforts to meet our ambitious goals and clientsâ€™ requirements are consolidated in our offered wide assortment of superior quality coating products, which includes Industrial Coating Paints, Industrial Coating Primers, and Industrial Coating Thinner. To demonstrate our operational excellence, we bring forth a qualitative range of products featuring a comprehensive line of benefits of uniformed coating, resistance to chemical, superior protection from corrosion, smooth and aesthetic finish.\r\n\r\nWe strive for recognition of a trusted business entity, thereby we invested enormously in the knowledge resources, which help us to gauge the clientsâ€™ business needs. Further, we conduct rigorous market analysis, encapsulating our efforts to nurture a customer oriented perspective. We ensure that our', 'Green Touch Paints is a leading Industrial Coatings and Paints manufacturer and supplier, established in 1985 at Pune, Maharashtra, India. Initiating our business with the processing of general purpose coatings, now we have excelled the domain with a broad spectrum of Aluminium Paints, Bituminous Paints, Epoxy Ester Finishes, Quick Drying Paints, Synthetic Paints, Synthetic Enamel Paints, Polyurethane Paints, etc. All these are manufactured by our team of expert, holding complete domain knowledge and experience. They utilize high grade raw materials and advanced technologies to manufacture bulk quantities of products within minimal cost and time. This has helped us provide our clients with economically priced products which are appreciated for their longer Shelf life, Solubility, Purity and customised Packaging. Ensuring prompt deliveries and flexible payment options to our clients has enabled us to retain them for longer durations and we strive to continue the same in future.', 'Backed by well established state-of-the-art infrastructure that is fully equipped with the latest and innovative technique of production that enables us to manufacture quality range of Paints and Coatings. We have three manufacturing units, which are spread across sprawling areas of 4,000, 15,000, and 5,000 sq. ft respectively. These units are equipped with all the ultra modern tools and equipment.', 'Backed by well established state-of-the-art infrastructure that is fully equipped with the latest and innovative technique of production that enables us to manufacture quality range of Paints and Coatings. We have three manufacturing units, which are spread across sprawling areas of 4,000, 15,000, and 5,000 sq. ft respectively. These units are equipped with all the ultra modern tools and equipment.', 'Backed by well established state-of-the-art infrastructure that is fully equipped with the latest and innovative technique of production that enables us to manufacture quality range of Paints and Coatings. We have three manufacturing units, which are spread across sprawling areas of 4,000, 15,000, and 5,000 sq. ft respectively. These units are equipped with all the ultra modern tools and equipment.', '', '', 'Tata Moters\r\nHindalco \r\nMahindra Moters', '1985-05-01', '', '', 'Epoxy Paints', 'Polyurethane Paints (PU)', 'Quick Drying Paint', 'Synthetic Enamels Paints', '', '', '', '', '9 AM To 8 : 30 PM', '', 'regularity compliances,safety and security,csr (corporate social responsibility)', '', 'yes', 'yes', 'Select Annual Output Value', '8', '1,2,4,5,7,13', '0,3,6,7,8', '1,2,7', '1', '51', '2315', '', '485.png', '485.jpg', '485.jpg', 'noimage.jpg', 'https://www.b2bharat.com/company-detail/Green Touch Paint', '2018-02-28 21:05:25', '2018-03-10 10:18:40', 1);
