(1664, 481, 59, 0, '', 'fdgdfgdfg', '2', 'Product-481-5aa10168c5464.jpg', 'Product-481-5aa10168d39f7.jpg', 'Product-481-5aa10168e161a.jpg', 'Product-481-5aa10168ef0d6.jpg', NULL, 'Brochure-481-5aa10168c538d.jpg', NULL, 'fdgdfgdfg', 2315, 2316, 1023, 'Epoxy Paint | Epoxy Paint | Epoxy Paint | Epoxy Paint', '', '', '', NULL, '232', 'Ampere', 23, 0, 'yes', 1, '', '4', 'Yard', '', '', 'Yard', '', '', '', '3', 'Yard', NULL, 'Product Brief Description svsvds vvv ffvfv wfwf efewfewf', 'We are amongst the most prominent names in the industry, offering functionally updated array of Epoxy Zinc Rich Primer that are accurate in composition and have high strength. Our entire product range ensures excellent coating and is environment friendly in nature. Epoxy Zinc Rich Primer have two Components, Polyamide Cured, Air Drying, high build Epoxy Zinc Rich Primer with 60% zinc dust loading. Compatible with wide range of top coats & provides excellent protection in marine & saline environment.\r\n\r\n\r\n\r\nFeatures of Epoxy Zinc Rich Primer:\r\n\r\n\r\n\r\nColor â€“ Grey\r\nGloss â€“ Matt\r\nVolume solids â€“ Approximately 55 %\r\nDry film thickness/coat â€“ 40 to 80 microns\r\nTheoretical coverage â€“ 9 to 11 m2/ liter at 40 microns 5 to 6 m2/ liter at 80 microns\r\nMixing ratio â€“ 4: 1 (by volume), Base: Hardener\r\nFlash point - Not below 21Â° C\r\nDrying time - Touch Dry- 15-30 mines\r\nHard Dry- 6-8 hours\r\nFull Cure- 7 days\r\nOver coati', 'gtggre rrrr fewfewfewf wefewfewfe fewfewfewfefew wefewfewfewfewf', 'pune', '', '', '', '', '', '', '', 'cif', 'sd', '', '', '', '', '', '2018-03-08 14:54:56', NULL, '2018-04-12', 0, 1, 0),
